			  	"category" : navHTML.category,
			  	"placement" : i,
			  	"attribute" : $(this).parents('li.x-refine__main__list').find('h3.x-refine__item').text(),
			  	"value" : $(this).text(),
			  	"URL" : formatSearchFromBrowseURL($(this).attr('href')),
